import { useQuery } from "@tanstack/react-query";
import { request } from "../../utils/axios";

export const useGetPostInteractionQuery = ({ post_id, queryKey, endpoint }) => 
    useQuery([queryKey, { post_id }], () => 
        request.get(endpoint, {
            params: {
                post_id,
            }
        }).then(res => res.data)
    )
